.bondDetailBox{
  li{
    width: 33%;
    display: inline-block;
  }
  p{
    line-height: 30px;
    span:nth-child(1){
      color: $--color-grey;
      display: inline-block;
      width: 50%;
    }
  }
}
  .tabs{
    .el-tabs__nav-wrap::after{
      background-color: #fff;
    }
    .el-tabs__active-bar{
      height: 3px;
      background-color: transparent;
      &:before{
        position: absolute;
        content: "";
        left: 50%;
        right: 50%;
        width: 20px;
        margin-left: -10px;
        margin-right: -10px;
        height: 3px;
        background-color: $--color-primary;
      }
    }

    .el-tabs__item{
      color: $--color-grey;
      font-size: 13px;
      &:hover{
        color: $--color-black;
      }
      &.is-active{
        font-size: 16px;
        color: $--color-black;
      }
    }

    .el-tabs__content{
      overflow: visible;
    }
    .analysistabs{
      text-align:center;
      }
  }
